import React, { Component } from 'react'
import Teksti1 from './Teksti1';
import './jono.css';
// import Numero1 from './Numero1';

class Jono extends Component {

    constructor(props) {
      super(props)


        this.state = {date: new Date()};

    }



      componentDidMount() {
        this.timerID = setInterval(
          () => this.tick(),
          1000
        );
      }

      componentWillUnmount() {
        clearInterval(this.timerID);
      }

      tick() {
        this.setState({
          date: new Date()
        });
      }



  render() {
    return (
      <div className="outer">
          <br />
          <Teksti1 teksti="Montako jonossa" divi="teksti1"/>
          <Teksti1 teksti="Seuraava numero" divi="teksti2"/>
          <br /><br />
          <Teksti1 teksti="1" divi="numero1"/>
          <Teksti1 teksti="1" divi="numero2"/>
          <br /><br /><br /><br />
          <Teksti1 teksti="Oma Numero" divi="teksti2"/>
          <br /><br />
          <Teksti1 teksti="1" divi="seuraava"/>
          <br /><br />
          <button className="omanumero" onClick="null">Ota Numero</button>
          <br /><br />
          <button className="peruuta" onClick="null">Peruuta numero</button>
          <h2>{this.state.date.toLocaleTimeString()}.</h2>
      </div>
    )
  }
}

export default Jono
